review_text:
@用餐日期：2018/02/10，晚上5:30 左右。  
@用餐人數：2人  
@餐點選擇：$398+10% ，北海道昆布鍋套餐，無再加價加點，使用餐券。  
@用餐環境與服務一如王品招牌，都很優質。適合家庭聚餐。人很多，需先訂位。  
@以4百多的火鍋餐點來看，偏向普通。可再加強名為“北海道”的特色。  

1、湯頭選擇：北海道昆布湯 & 辛味增昆布湯。鴛鴦鍋。湯底普通，無特別驚艷感。  
2、主餐：雪花豬肉&鮮嫩雞肉。豬肉好吃，但蠻薄的，份量也不多。雞肉普通。肉類選擇少。  
（沾醬：餐桌上附的是胡麻醬 & 蘿蔔泥+調和醬汁 微酸口感，沙茶醬需詢問服務人員另外提供）  
3、時蔬拼盤，另有搭配料選擇：海鮮漿&魚麵。其實味道兩者都像是一般火鍋料魚漿的味道。  
4、梅子醋：可續，微酸味道不錯。  
5、副食：日式粉絲&芝香白飯。  
6、甜品：熱銀耳蓮子釀&冰紅豆豆腐湯。兩個還不錯。  
7、飲品：哈密瓜冰沙&黑豆奶茶去冰。可隨餐點附上。哈密瓜冰沙味道很人工，黑豆奶茶還可。
